import React, { Component } from 'react';
import PropTypes from 'prop-types';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

export class LayerChooser extends Component {
  render() {
    const { id, text, icon } = this.props.layer;
      return (
        <div className="d-flex mb-2 justify-content-between">
          <button onClick={this.props.selectLayer.bind(this, id)} type="button" className="btn btn-default btn-circle btn-xl"><p>{ text }</p><FontAwesomeIcon icon={ icon } size="2x"/></button>
        </div>
      )
    }
  }

LayerChooser.propTypes = {
  layers: PropTypes.object.isRequired
}

export default LayerChooser;
